	private static final String COMMAND = "blockchain_get_feeds_for_asset";
	
	public static CommandJson test(String assetSymbol) {
		return doTest(COMMAND, new Object[] { assetSymbol });
	}
	
	public static List<MarketFeed> run(String assetSymbol) throws BTSSystemException {
		return run(0, assetSymbol);
	}
	public static List<MarketFeed> run(int id, String assetSymbol) throws BTSSystemException {
		BlockchainGetFeedsForAsset i = (BlockchainGetFeedsForAsset) new BlockchainGetFeedsForAsset().doRun(
				id, COMMAND, new Object[] { assetSymbol });
		i.checkSystemException();
		return i.getResult();
	}
	
